using DSPLib;
using Industry4Control.Constants;
using Industry4Control.Data;
using System;
using System.IO;
using System.Numerics;
using System.Runtime.Serialization.Formatters.Binary;

namespace Industry4Control.Utils
{
    internal static class Helper
    {
        public static double[] DoFft(double[] voice)
        {
            FFT fft = new FFT();
            fft.Initialize((uint)voice.Length);
            Complex[] resultsInComplex = fft.Execute(voice);
            if (resultsInComplex != null)
            {
                return DSP.ConvertComplex.ToMagnitude(resultsInComplex);
            }

            return null;
        }

        public static double[] GetHannWindow(int windowSize)
        {
            double[] hann_window = new double[windowSize];
            for (int i = 0; i < windowSize; i++)
            {
                hann_window[i] = 0.5 * (1 - Math.Cos((2 * Math.PI * i) / (windowSize - 1)));
            } 

            return hann_window;
        }

        #region Serialization

        public static bool SaveControlVoice(short[] data, ControlFunction function)
        {
            try
            {
                // load the saved data if it exists
                SavedData loadedData = LoadSavedData();
                if (loadedData != null)
                {
                    // Extend the already saved data
                    if (loadedData.SavedFunctions.ContainsKey(function))
                    {
                        // Update the existing item in the dictinary
                        loadedData.SavedFunctions[function] = new Voice(data);
                    }
                    else
                    {
                        loadedData.SavedFunctions.Add(function, new Voice(data));
                    }
                }
                else
                {
                    // Create a completely new data
                    loadedData = new SavedData();
                    loadedData.SavedFunctions.Add(function, new Voice(data));
                }

                // save in binary format
                FileStream fileStream = new FileStream("data.bin", FileMode.OpenOrCreate, FileAccess.ReadWrite);
                BinaryFormatter binaryFormatter = new BinaryFormatter();
                binaryFormatter.Serialize(fileStream, loadedData);
                fileStream.Close();
            }catch(Exception e)
            {
                return false;
            }

            return true;
        }


        public static SavedData LoadSavedData()
        {
            SavedData savedData = null;

            if (File.Exists("data.bin"))
            {
                FileStream fileStream = new FileStream("data.bin", FileMode.Open, FileAccess.ReadWrite);
                BinaryFormatter binaryFormatter = new BinaryFormatter();
                savedData = binaryFormatter.Deserialize(fileStream) as SavedData;
                fileStream.Close();
            }

            return savedData;
        }

        #endregion

        #region ParameterVector

        public static ParameterVector[] CreateParameterVectors(short[] voice)
        {
            double[] hannWindow = Helper.GetHannWindow(Parameters.WindowSize);
            double[] windowSizedSignal = new double[Parameters.WindowSize];
            double[] spectrum;

            using (StreamWriter writer = new StreamWriter("voice.txt"))
            {
                foreach (short data in voice)
                {
                     writer.Write(((int)data).ToString() + "\n");
                }
            }

            ParameterVector[] pVectors = new ParameterVector[86];

            int dataCounter = Parameters.WindowSize / 2;
            int halfWindowSize = Parameters.WindowSize / 2;
            int vectorIndex = 0;
            double max = 0;

            while (dataCounter < voice.Length)
            {
                //windowing
                int from = dataCounter - halfWindowSize;
                int to = dataCounter + halfWindowSize;
                for (int i = from, j = 0; i < to; i++, j++)
                {
                    if (i < voice.Length)
                        windowSizedSignal[j] = voice[i] * hannWindow[j];
                }

                spectrum = DoFft(windowSizedSignal);

                pVectors[vectorIndex] = GetMelSpectrum(spectrum);
                double localMax = pVectors[vectorIndex].GetMax();
                if (max < localMax)
                {
                    max = localMax;
                }

                vectorIndex++;

                dataCounter += halfWindowSize;
            }

            foreach(ParameterVector pVector in pVectors)
            {
                pVector.ActivateMax(max);
            }

#if DEBUG
            using (StreamWriter writer = new StreamWriter("pVectors.txt"))
            {
                foreach(ParameterVector pvector in pVectors)
                {
                    double[] melSpectrum = pvector.GetMelSpectrum();
                    foreach(double value in melSpectrum)
                    {
                        writer.Write(((int)value).ToString()+" ");
                    }
                    writer.Write("\n");
                }
            }
#endif

            return pVectors;
        }

        private static ParameterVector GetMelSpectrum(double[] spectrum)
        {
            ParameterVector pv = new ParameterVector();
            double[] vector = new double[30];
            for (int i = 0; i < 30; i++)
            {
                for (int j = FilterLimits[i, 0]; j < FilterLimits[i, 1] + 1; j++)
                {
                    vector[i] += spectrum[j] * MelFilter[i, j];
                }
            }
            pv.SetMelSpectrum(vector);
            return pv;
        }

        #endregion

